import React from 'react'
import Card from '../Card'
import './style.css'
import AddCard from '../AddCard'

const CardList = ({list, onRemove=f=>f, isHide, Save=f=>f, freeId, AddCard=f=>f})=>
    <div hidden={isHide}>
        <div>Users:</div>
        <div className='list-cards'>
            <div>
                {list.map(card=>

                    <Card key={card.id} {...card} 
                        onRemove={()=>onRemove(card.id)} 
                        onSave={Save}
                    />
                    )
                }
            </div>
            <AddCard freeId={freeId} onAddCard={AddCard}/> 
        </div>

    </div>

